import React, { Component } from "react";
import "./style.css";

class Finish extends Component {
  render() {
    return (
      <div className="finish">
        <input redf type="text"  />
        <button onClick={this.props.startNewGame}>Play again</button>
      </div>
    );
  }
}

export default Finish;
